import React, { useState, useRef } from 'react';
import './App.css'
import one from './inc/one';
import test from './inc/test';
import { BrowserRoute, Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <BrowserRoute>
        <Route path='/' exact Component={one} />
        <Route path='/test' Component={test} />
      </BrowserRoute>
    </div>
  );
}

export default App;
